description:
This is a Windows 2003 Enterprise x86 version which is updated upto Nov 2009. No Tools like Nlite is used. Our aim was to create a version which is fairly stable with no flashy content like the other modified Windows running around. Normal Nlite based modified Windows might show some problems when updating/repairing a current windows setup. So about RockStable - Though we got the final aim of having a pretty stable edition, it has just one problem - its huge size. But we feel that this will be worth it.

